import axios from 'axios';

class FavoriteApi {
    url = '/api/books';

    async saveFavorite() {
    	return axios.post();
    }

    async deleteFavorite() {
    	return axios.delete();
    }

    async getFavorites() {
    	return axios.get();
    }
}

export default FavoriteApi;
